import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {

  const [applications, setApplications] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:4000/applications')
      .then(response => {
        setApplications(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h1>Applications</h1>

      <button onClick={applications.map(applications => (
        <li key={application.id}>{application.name}</li>
      ))}>get applications</button>
    </div>
  );
}

export default App;
